css:
.auto-cursor {
  cursor: default;
}
.kite-hover {
  z-index: 400 !important;
}
kite-hover {
  display: flex;
  flex-direction: column;
  background: #21252b;
  color: #d7dae0;
  padding: 5px;
  border-radius: 3px;
  font-family: system-ui;
  overflow: hidden;
  box-shadow: 4px 4px 20px rgba(0, 0, 0, 0.4);
  animation: fade-in 100ms;
  cursor: default;
}
@keyframes fade-in {
  0% {
    opacity: 0;
    transform: translate(0, -3px);
  }
  100% {
    opacity: 1;
    transform: translate(0, 0);
  }
}
kite-hover code {
  font-family: var(--editor-font-family);
  font-size: 0.9em;
  line-height: var(--editor-line-height);
  padding: 0;
  background: inherit;
}
kite-hover .debug {
  margin-top: 5px;
}
kite-hover .debug pre {
  cursor: text;
  -webkit-user-select: all;
  user-select: all;
  max-height: 300px;
  max-width: 500px;
  overflow: auto;
}
kite-hover .debug pre > * {
  pointer-events: none;
}
kite-hover .definition {
  display: flex;
  flex-direction: row;
  align-items: baseline;
  line-height: initial;
  margin-top: -3px;
  width: max-content;
}
kite-hover .definition .name {
  word-break: break-word;
}
kite-hover .definition .type {
  font-size: 90%;
  display: inline-block;
  flex: none;
  padding: 0em .2em;
  margin-right: -0.2em;
  margin-left: 0.5em !important;
  pointer-events: none;
  color: #9da5b4;
}
kite-hover .definition kite-logo {
  flex: none;
  align-self: center;
}
kite-hover .definition kite-logo.badge {
  margin: 0;
  width: inherit;
  height: inherit;
}
kite-hover .definition kite-links {
  flex: none;
  margin-left: 0.5em !important;
  align-items: baseline;
}
kite-hover .definition kite-links a,
kite-hover .definition kite-links a:hover,
kite-hover .definition kite-links a:active,
kite-hover .definition kite-links a:focus {
  pointer-events: all;
}
kite-hover .definition kite-links a {
  color: #6494ed;
  padding-top: 0;
  padding-bottom: 0;
}
kite-hover .definition kite-links a:last-of-type {
  padding-right: 0;
}
kite-hover .definition kite-links a:first-of-type {
  padding-left: 0;
}
kite-hover .definition kite-links a:hover {
  color: #d7dae0 !important;
  cursor: pointer;
}
kite-hover .definition .signature,
kite-hover .definition a,
kite-hover .definition a:hover,
kite-hover .definition a:focus,
kite-hover .definition a:active {
  color: #9da5b4;
  pointer-events: none;
}
kite-hover .definition > * {
  flex: 1 1 0;
}
kite-hover .definition > *:empty {
  display: none;
}
kite-hover .definition > *:not(:first-child) {
  text-align: center;
  margin-left: 5px;
}
kite-hover kite-links {
  display: flex;
  align-items: center;
  align-content: center;
}
